import React, { Component } from "react";
import Card from "react-bootstrap/Card";
import { runInThisContext } from "vm";

class IndexInfo extends Component {
  render() {
    return (
      <React.Fragment>
        <Card bg="light" style={{ width: "18rem" }}>
          <Card.Body>
            <Card.Title>Current Level</Card.Title>
            <Card.Text>{this.props.index.currentValue}</Card.Text>
          </Card.Body>
        </Card>

        {this.state.index.returns.map(returns => (
          <Card bg="light" style={{ width: "18rem" }}>
            <Card.Body>
              <Card.Title>1hr Variation</Card.Title>
              <Card.Text>{returns}</Card.Text>
            </Card.Body>
          </Card>
        ))}
      </React.Fragment>
    );
  }
}

export default IndexInfo;
